    public static void createImg(String json,String path){
        String basepath = path;
       // long l = System.currentTimeMillis();
        // String[] split = mobileSampleQueryParam.getPointstr().split(":");
        File f = new File(basepath + "/out");
        f.mkdirs();
        //解析shp
        Gson gson = new Gson();
        List<Feature> features = new ArrayList<>();
        // 解析JSON数组
        JsonArray jsonArray = gson.fromJson(json, JsonArray.class);
        for (JsonElement jsonElement : jsonArray) {
            JsonArray asJsonArray = jsonElement.getAsJsonArray();
            for (JsonElement element : asJsonArray) {
                JsonObject jsonObject = element.getAsJsonObject();
                Point point = Point.fromLngLat(jsonObject.get("lgd").getAsDouble(), jsonObject.get("ltd").getAsDouble());
                Feature feature = Feature.fromGeometry(point);
                feature.addNumberProperty("time",jsonObject.get("time").getAsNumber());
                features.add(feature);
            }
        }
        FeatureCollection featureCollection = FeatureCollection.fromFeatures(features);
        double[] bbox = TurfMeasurement.bbox(featureCollection);
        boolean b = MapScreenshotTool.downLoadImage(bbox, 18, null, basepath + File.separator + "image.png", basepath  + File.separator + "image.png.aux.xml");
        if(b){
            String jsonString = featureCollection.toJson();
            // 指定要写入的文件名
            String fileName =basepath+File.separator+"shape.json";

            try {
                // 将JSON字符串写入文件
                Files.write(Paths.get(fileName), jsonString.getBytes(StandardCharsets.UTF_8));
                System.out.println("JSON数据已成功写入文件 " + fileName);
            } catch (IOException e) {
                e.printStackTrace();
            }
        }else {
            File folder = new File(basepath );
            deleteFolder(folder);
        }

    }

    public static void deleteFolder(File folder) {
        if (folder.isDirectory()) {
            File[] files = folder.listFiles();
            if (files != null) {
                for (File file : files) {
                    deleteFolder(file);
                }
            }
        }
        folder.delete();
    }
